import React from 'react';
import logo from './logo.svg';
import './App.css';

class Square extends React.Component {
  render() {
    return (
      <button className="square" onClick="function">
        {/* TODO */}
      </button>
    );
  }
}

function CustomRendererForGrids() {
  let x = []
  for(let i = 0; i < 1; i++) {
    x.push(<Square />);
  }
  return (<div>{x}</div>);
}

function Prototype() {
  let x = []
  for(let i = 0; i < 10; i++) {
    x.push(<CustomRendererForGrids />);
  }
  alert("Hello");
  return (<div>{x}</div>);
}

function App() {
  return (
    <div className="App">
      <Prototype />
    </div>
  );
}

export default App;
